import React from 'react';
import Footer from '../Footer/index';

const styles = {
    buttons: {
        margin: 5
    }
}

function Chart() {

    return (
        <div>

            <div className="form-control" style={styles.buttons}>
                <button className="btn btn-dark" id='line'>Line</button>
                <button className="btn btn-dark" id='bar'>Bar</button>
                <canvas className="" id="myChart"></canvas>
            </div> 

            <Footer/>
        </div>
    )
}

export default Chart;
